  false,\n\t\"url\": null,\n\t\"notes\": \"The Bayou Cocodrie NWR Forest Management
  Plan provides a long-term vision and specific guidance on managing forest habitat
  for the resources of concern at Bayou Cocodrie NWR, to facilitate continuity in
  management programs. Refuge background, resources of concern, and habitat management
  goals and objectives are discussed. Management strategies and prescriptions then
  identify how and the specific means by which management and monitoring strategies
  will be implemented.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
